import Content from "../content/Content";

function NavBar() {
    return (
        <ul className="nav justify-content-end mt-3">
            <li className="nav-item">
                <a href="#" className="nav-link mynavlink">Home</a>
            </li>
            <li className="nav-item">
                <a href="#" className="nav-link mynavlink" onClick>Sobre</a>
            </li>
            <li className="nav-item">
                <a href="#" className="nav-link mynavlink">Lista de Livros</a>
            </li>
            <li className="nav-item">
                <a href="#" className="nav-link mynavlink">Cadastrar</a>
            </li>
        </ul>
    );
}
export default NavBar;
